(function() {
  var soundify = require('./soundify');

  var imageData = 'data:image/png;base64,';
  var soundData = {  
    DESTROY: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    }
  };
  var sounds = soundify(soundData);
  
  function DestroyEffect(x, y) {
    this.x = x;
    this.y = y;
    this.frameIndex = 0;
    this.animationEnded = false;
    this.onAnimationEnded = null;
    var image = document.createElement('img');
    image.src = imageData;
    var canvas = document.createElement('canvas');
    canvas.width = 32;
    canvas.height = 32;
    canvas.style.position = 'absolute';
    canvas.style.left = Math.floor(x-16)+'px';
    canvas.style.top = Math.floor(y-16)+'px';
    document.body.appendChild(canvas);
    var context = canvas.getContext('2d');
    this.render = function() {
      context.clearRect(0,0,32,32);
      context.drawImage(image, 32*this.frameIndex, 0, 32, 32, 0, 0, 32, 32);
    };
    this.remove = function() {
      if(canvas !== null) {
        if(this.onAnimationEnded !== null) this.onAnimationEnded();
        canvas.parentNode.removeChild(canvas);
        canvas = null;
      }
    };
    this.tick = function() {
      this.frameIndex++;
      this.animationEnded = this.frameIndex >= 7;
      if(!this.animationEnded)
        this.render();
      else 
        this.remove();
    };
    this.render();
    sounds.DESTROY.play();
  }
  
  module.exports = DestroyEffect;
})();